es.Inferno.Value then				repeat					game.ReplicatedStorage.MysteryBox:InvokeServer("Inferno")					wait(7)				until game.Players.LocalPlayer.Crates.Inferno.Value == 0			end			if 0 < game.Players.LocalPlayer.Crates.Regular.Value then				repeat					game.ReplicatedStorage.MysteryBox:InvokeServer("Regular")					wait(7)				until game.Players.LocalPlayer.Crates.Regular.Value == 0			end			if 0 < game.Players.LocalPlayer.Crates.Red-Banded.Value then				repeat					game.ReplicatedStorage.MysteryBox:InvokeServer("Red-Banded")					wait(7)				until game.Players.LocalPlayer.Crates.Red-Banded.Value == 0			end			if 0 < game.Players.LocalPlayer.Crates.Spectral.Value then				repeat					game.ReplicatedStorage.MysteryBox:InvokeServer("Spectral")					wait(7)				until game.Players.LocalPlayer.Crates.Spectral.Value == 0			end			if 0 < game.Players.LocalPlayer.Crates.Pumpkin.Value then				repeat					game.ReplicatedStorage.MysteryBox:InvokeServer("Pumpkin")					wait(7)				until game.Players.LocalPlayer.Crates.Pumpkin.Value == 0			end			if 0 < game.Players.LocalPlayer.Crates.Luxury.Value then				repeat					game.ReplicatedStorage.MysteryBox:InvokeServer("Pumpkin")					wait(7)				until game.Players.LocalPlayer.Crates.Pumpkin.Value == 0			end			if 0 < game.Players.LocalPlayer.Crates.Festive.Value then				repeat					game.ReplicatedStorage.MysteryBox:InvokeServer("Festive")					wait(7)				until game.Players.LocalPlayer.Crates.Festive.Value == 0			end			if 0 < game.Players.LocalPlayer.Crates.Magnificent.Value then				repeat					game.ReplicatedStorage.MysteryBox:InvokeServer("Magnificent")					wait(7)				until game.Players.LocalPlayer.Crates.Magnificent.Value == 0			end		end	endend)Layouts1Save.MouseButton1Down:connect(function()	game:GetService("ReplicatedStorage").Layouts:InvokeServer(Check)	game:GetService("ReplicatedStorage").Layouts:InvokeServer("Save", "Layout1")	game:GetService("Repli