arent:IsA("Part") then								ClickEvent:FireServer(desc.Parent)							end						end					end				end			end		end	endend)mouse.KeyDown:connect(function(key)	if key == "k" then		local ClickEvent = game:GetService("ReplicatedStorage"):WaitForChild('Click');		local CheckFactory = function()			for i,v in pairs(workspace.Tycoons:GetChildren()) do				if v:FindFirstChild('Owner') then 					if v.Owner.Value == game.Players.LocalPlayer.Name then						return v					end				end			end		end		local Factory = tostring(CheckFactory())		local basepart = workspace.Tycoons[Factory]:GetChildren()		for i,v in pairs(basepart) do			if v.Name == "Reversible Conveyor" then				for _,desc in pairs(v:GetDescendants()) do 					if desc:IsA("ClickDetector") then 						if desc.Parent:IsA('Part') then 							ClickEvent:FireServer(desc.Parent)						end					end				end			end		end		notify'Switching ALL Reversible Conveyors'	endend)function CountBricks()  local count = 0    for i,v in pairs(workspace:GetChildren()) do		for x in string.gmatch(v.Name, "Crate") do			if v.Name ~= "GiftCrate" then				wait(0.02)				count = count + 1			end        end	end    for i,v in pairs(workspace.Shadows:GetChildren()) do		for x in string.gmatch(v.Name, "Crate") do			wait(0.02)            count = count + 1        end    end   return countendspawn (function()	while true do		wait(0.1)		CountTpCrates.Text = CountBricks()	endend)ItemBuyButton.MouseButton1Down:connect(function()	local item = ItemText.Text	local amount = tonumber (AmountText.Text)	if amount == 0 then return end	game.ReplicatedStorage.BuyItem:InvokeServer(item, amount)	notify('Bought ' .. amount .. ' x ' .. item)end)end